// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract Item {

    event BidCreate(address _by, uint _amount, uint _tokenId, uint _totalBidAmount);

    uint public tokenId;
    uint public biddingEndTimestamp;
    address public owner;

    struct Bid {
        uint amount;
        address by;
    }
    mapping(address => Bid[]) bids;

    uint public highestBid;
    address public highestBidder;

    mapping(address => uint) public totalBidAmount;

    constructor(uint _tokenId, address _owner, uint _biddingEndTimestamp) {
        tokenId = _tokenId;
        owner = _owner;
        biddingEndTimestamp = _biddingEndTimestamp;
    }

    modifier onlyHigherBid(uint _amount) {
        require(_amount > highestBid, 'Bid amount must be higher than last bid');
        _;
    }

    modifier onlyWithinBidPeriod() {
        require(block.timestamp <= biddingEndTimestamp, 'Bidding period is over');
        _;
    }

    function addBid(address _by, uint _amount) public onlyHigherBid(_amount) onlyWithinBidPeriod {
        Bid memory bid = Bid(_amount, _by);

        bids[_by].push(bid);
        totalBidAmount[_by] += _amount;

        highestBid = _amount;
        highestBidder = _by;

        emit BidCreate(_by, _amount, tokenId, totalBidAmount[_by]);
    }

    function lastBidAmount(address _by) public view returns(uint) {
        if (bids[_by].length <= 0) return 0;

        uint lastBidIndex = bids[_by].length - 1;
        return bids[_by][lastBidIndex].amount;
    }

    function getTimestamp() public view returns(uint) {
        return block.timestamp;
    }
}
